import Card from "./Card";
import Users from "./users.json";

const Grid = ({ name, lastName, group, picture }) => {
  return (
    <div className="grid grid-cols-3 md:grid-cols-1 lg:grid-cols-3 gap-6">
      {Users.map((user) => {
        return (
          <Card
            key={user.id}
            name={user.name}
            lastName={user.lastName}
            group={user.group}
            picture={user.picture}
          />
        );
      })}
    </div>
  );
};

export default Grid;
